import './App.css';
import useState from 'react';


function App() {
  [pool, changePool] = useState("Cheese", "Potato");

  const handleChange = (e) => {
    changePool(e.currentTarget.value)
  }

  return (
    <div className="App">
      Decision Royale

      {pool.map((option) => {
        return <div key={option}>{option}</div>;
      })}

      <input value={pool} type="text" onChange={handleChange} placeholder="Enter task..."/>
    </div>
  );
}

export default App;
